          "text": "New and improved escalators from concourse level to the Millennium Line platform at Commercial\u2013Broadway SkyTrain Station will open September 27, 2024.  \r\n\nOn the same day, the two nearby escalators serving Expo Line platforms 3 & 4 (near Booster Juice) will close for replacement. \r\n-\tThe accompanying stairs will also close to ensure the safety of the public and crews throughout construction. \r\n-\tThe elevator will remain open for those who need it. \r\n\nCustomers can transfer to/from Expo Line platforms 3 & 4 through the station entrance next to Safeway on the opposite side of E Broadway. \r\n\nThere is no change to SkyTrain services during this time, however, there will be detours within the station and customers may experience more crowding and congestion during this time. Please allow an extra five minutes for  your transit trip if using the Expo Line at Commercial-Broadway Station.\r\n\nAs part of the replacement works, two faregates at the East Broadway Ave entrance have been removed from",
